module.exports = {"nation":{"head":"国のルール","list":[{"head":"ここは長期人狼サーバーだ。短期はできない。","log":"ネット上の人狼ゲームの種類は、<a href=\"http://crazy-crazy.sakura.ne.jp/giji/?(Knowledge)Guidance#l1\">リンク先を参考</a>にしよう。\n人狼議事は長期人狼を遊ぶ場所なので、<span class=\"tooltip-top\" data-tooltip=\"１０分とか、５分とか。\n……ひどいときは１分だぜ。クール！\">短期人狼</span>には対応していない。\nアクセスが集中すると、あの白くて殺風景な、忌々しい霧が発生するかもしれないんだ。２３時～２時(２６時)の範囲は利用が集中しているので、特にあぶない。\nこういう遊びかたには、もっとふさわしい<a href=\"http://wolfbbs.jp/%BF%CD%CF%B5%A5%AF%A5%ED%A1%BC%A5%F3.html#content_1_18\">別の場所</a>があるから、そちらで思いっきり楽しむといい。"},{"head":"情報ページ（ここ）を熟読する。","log":"参加したらもう、知らなかった、忘れてた、はナシだ。そしてそんなふうに言われないよう、解りやすいルールを見やすい場所に記そう。"},{"head":"ルールを守り、つねに心構えに気を配る。","log":"もし不明な部分、迷う部分があったら、抱えていることはない。プロローグのうちに積極的に問いかけて明らかにしておこう。\nルール違反で迷惑を被ったなら、遠慮なく非難しよう。\n気付かなかった、はナシだ。"},{"head":"進行中は、どんな嘘でもＯＫ。","log":"プロローグ終了からエピローグ開始までが、ゲームの進行中だ。この期間は全員、勝利のためにあらゆる手段を講じている。\nだから、あらゆる発言が嘘かもしれないし、嘘と受け取られる可能性があるんだ。\nただしプロローグとエピローグだけは特殊で、ルールそのものを作っていく場であり、すべて明らかになっての反省会でもある。\nひょっとしたらルール違反の指摘もあるかもしれない。だから<span class=\"tooltip-top\" data-tooltip=\"ホントごめん！仕事が終わらなかったんだ！\nとか、そういうやつ。\">勝つためと思われたくない主張</span>を本気でしたいときは、誤解の少ないエピローグまで待つ方が確実だ。\nこれはゲームを楽しむためのルールだけれど、村建て人と、管理人だけはそれでは困るんだ。彼等から特別な発言があったら、そこに嘘やハッタリは含まれていない。\n勝敗よりも優先することを発表したり、問いかけたりするから、疑わずに聞いてほしい。"},{"head":"ただし、村建て人、管理人、の発言では嘘をつかないこと。","log":""},{"head":"突然死をしない。","log":"丸一日のあいだ発言を一切しないと、その人物は死んでしまう。このことを突然死と呼んでいるんだ。\n人狼議事は会話を楽しむゲームだってことを思い出してほしい。これじゃ、なんのために村に参加したのか、わからないよね。だから死んでしまうことにしている。\n事情があってなかなか喋れないとき、事情よりもゲームを優先するのはとても難しいことだ。だから、ゲームの時間が残るように、計算高くいろいろ企むといい。\n突然死をすると有利になる状況は、よく探すとごろごろしてる。けれど狙わないこと。それはルール違反だ。"}]},"village":{"head":"村のルール（編集可能）","list":[{"head":"多重ログインをしない。","log":"つまり、同じ人が同じ村に、複数のキャラクターで参加してはいけない。それは狡いし、簡単に勝てるチョロい方法なんだ。そんな程度の勝ち方じゃつまらないだろ？"},{"head":"システムの出力内容を、そのまま書き写さない。","log":"きみなりの言葉で、伝えるべき内容を主張するんだ。そのほうが面白いし、きみの言葉を人間の綴る発言として読んで貰える。\nコンピューターのアウトプットしたオクテットストリングスなんかではなくてね。\nそして読むときにも、機械っぽい正確さに頼らないこと。そんな考え方をしたせいで推理を誤ったって、誰のせいにもできない。"},{"head":"エピローグまで秘密を守る。参加中の村の内容は秘密だ。","log":"きみ自身の役職、相方の存在、判定、思考していることなど、村に関わることを村の外で話してはいけない。場